import React from 'react'



class MatchList extends React.Component{
    render(){
        return(
            <div>
                {this.props.MatchList.map(match => {
                    return(
                    <p>{match.asesinatos}</p>
                    )
                })}
                <h1>oLA</h1>
            </div>
        )
    }
}

export default MatchList
